import React from 'react';

interface Props {
  link: string;
}

function CarouItem({ link }: Props) {

  const itemS: React.CSSProperties = {
    background: `url(${link})`,
    width: '100vw',
    height: '100vh',
    backgroundPosition: 'center center',
    backgroundRepeat: 'no-repeat',
    backgroundSize: '100% 100%',
  };


  return (<>
    <div style={itemS}></div>
  </>);
}
export default CarouItem;
